@deleted-role We have merged release/4.0.0 to main. This update introduces several new APIs and refactors the code, so it is required that validators manually apply these changes and update. I will bump the min spec version tomorrow to enforce validators to update. 

Steps for validators:
pm2 delete all

make a .env file that should look like this:
```
export OPENAI_API_KEY=
export GOOGLE_API_KEY=
export ANTHROPIC_API_KEY=
export GROQ_API_KEY=
export AWS_ACCESS_KEY=
export AWS_SECRET_KEY=
export PIXABAY_API_KEY=```

steps to get all of these new API keys are in the README here: https://github.com/Datura-ai/cortex.t/tree/main?tab=readme-ov-file#setup

Note that all the new api keys are free: pixabay, groq, and google all have free tiers that validators will suffice with. 

